import { ReactComponent as Logo } from 'src/assests/images/logo.svg'

export default function Header() {
  return (
    <>
      <header className="site-header">
        <div className="logo-container">
          <Logo className='logo'/>
        </div>

        
      </header>
    </>
  )
}
